import React from 'react'
import Header from './htmlparts/Header';
import Introduction from './htmlparts/Introduction';

import img1 from "../src/img/0.png"


function App() {
    const cards = [
        {img: "0.png", text: "OASIS - небольшая частная компания, созданная более 5 лет назад, для улучшения качетсва жизни на загородном участке..."},
        {img: "3.png", text: "Наша конманда состоит из опытных специалистов! Вот они справа надево"}
    ]

  return (
    <>
		<Header></Header>

        <div className="name">
            <div className="name-right">авотматический полив</div>
            <div className="name-center">и</div>
            <div className="name-left">ландшафтный дизайн</div>
        </div>
            {console.log("asdf asdf = " + window.location.origin)}
        <img src={window.location.origin + 'src/img/0.png'} alt=""></img>

        <Introduction cards={cards}></Introduction>
    </>
  )
}

export default App;
